message:
O PR estava muito calmo na coletiva e algumas coisas me chamaram a atenção:
- ele não falou sobre fraude mesmo sendo provocado a isso insistentemente;
- Flávio ficou ao lado apenas controlando pra ele não sair do script;
- o clima na esquerda é de velório. O plano deles era levar hoje e emplacar o discurso com  reconhecimentos internacionais;
- A grande vitória do dia foi a desmoralização pública das lojas de percentuais;
- sobre acreditar nos resultados das urnas disse apenas que aguarda o parecer do Min. Da Defesa;
- Teve muita fraude, vários BUs estranhos rolando;
- Os militares têm tudo.
Ninguém pode desanimar, hoje foi um dia de vitória, vencemos uma importante batalha, o silêncio da esquerda diz tudo, eles sabem que era hoje ou nunca mais.
